import styles from './Navbar.module.scss';

const Navbar = () => {
  return (
    <nav class="navbar">
      <div class="container">
        <div className={styles.input}>
          <input type="text" id="search" placeholder="Search" />
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
